import Header2 from "../2/Header2";

export default function Page5() {


    let [isGoing, setisGoing] = React.useState()


    let button = () => {

        setisGoing(false)
    }
    let button2 = () => {



        setisGoing(true)

    }




    return (

        <div>
            <Header2 />
            <h1 onClick={button} onDoubleClick={button2}>  {isGoing ? "Yes" : "NO"}</h1>

        </div>
    )
}
